          <div className={"container"}>
              <a href="/" className="footer__logo">
                  <img src="https://static.mediacdn.vn/nld.com.vn/image/logo-footer.png" alt=""/>
              </a>

              <div className="footer__infor">
                  
              </div>
          </div>
      </footer>
    );
}

export default Footer;
